import React, { useState } from "react";

function Planner() {
  // States
  const [typeOption, setTypeOption] = useState("");
  const [categoryOption, setCategoryOption] = useState("");
  const [amountValue, setAmountValue] = useState("");
  const [dateValue, setDateValue] = useState("");
  const [descriptionValue, setDescriptionValue] = useState("");

  // Categories mapped by type
  const categories = {
    income: ["Salary", "Interest", "Investments", "Bonuses", "Other Income"],
    expense: [
      "Rent",
      "Utilities",
      "Insurance",
      "Health/Medical",
      "Education",
      "Travel",
      "Subscriptions",
      "Loan payment",
      "Savings",
      "Leisure",
      "Clothes",
      "Food",
      "Other Expense"
    ]
  };


    const handleTransactionAdd = async () => {

    // Checking all fields are filled correctly

    // All fields are filled
    if (!email || !username || !password || !confirmPassword) {
      setError("All fields are required");
      return;
    }

    // Email is not valid
    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    if (!emailRegex.test(email)) {
      setError("Please enter a valid email address");
      return;
    }

    // Username is wrong length
    if (username.length < 2 || username.length > 64) {
      setError("Username must be between 2 and 64 characters");
      return;
    }

    // Password and confirm password don't match
    if (password != confirmPassword) {
      setError("Passwords do not match");
      return;
    }

    // Password is wrong length
    if (password.length < 8 || password.length > 64) {
      setError("Password must be between 8 and 64 characters");
      return;
    }

    // Password is not varied enough
    const passwordRegex = /^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)(?=.*[!@#$%^&*()_+]).*$/
    if (!passwordRegex.test(password)) {
      setError("Password must contain uppercase letters, lowercase lettesr, at least one number and a special character");
      return;
    }

    // Sending registration request
    try {
      const response = await fetch("http://localhost:5000/api/register", { 
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ email, username, password }),
      });

      const data = await response.json();

      if (!response.ok) {
        alert(data.message || "Registration failed");
        return;
      }

      alert("Registration successful!");
      navigate("/planner"); 
    } catch (error) {
      console.error("Error registering:", error);
      setError("Network error.");
    }
  };

  return (
    <div style={{
      display: "flex",
      minHeight: "100vh",
      backgroundColor: "#dbeeff",
      fontFamily: "Arial, sans-serif"
    }}>

      {/* Left Ribbon */}
      <div style={{
        width: "300px",
        backgroundColor: "#003366",
        padding: "20px",
        color: "white",
        display: "flex",
        flexDirection: "column",
        alignItems: "center"
      }}>
        <h2>ENTER A TRANSACTION</h2>

        {/* Transaction Type Dropdown */}
        <select
          value={typeOption}
          onChange={(e) => {
            setTypeOption(e.target.value);
            setCategoryOption(""); // reset category when type changes
          }}
          style={{
            padding: "10px",
            fontSize: "16px",
            borderRadius: "6px",
            border: "none",
            width: "100%",
            marginBottom: "20px"
          }}
        >
          <option value="">Transaction Type</option>
          <option value="income">Income</option>
          <option value="expense">Expense</option>
        </select>

        {/* Category Dropdown */}
        <select
          value={categoryOption}
          onChange={(e) => setCategoryOption(e.target.value)}
          disabled={!typeOption} // disabled until type is selected
          style={{
            padding: "10px",
            fontSize: "16px",
            borderRadius: "6px",
            border: "none",
            width: "100%",
            marginBottom: "20px"
          }}
        >
          <option value="">Category</option>
          {typeOption && categories[typeOption].map((cat, index) => (
            <option key={index} value={cat}>{cat}</option>
          ))}
        </select>

         {/* Amount */}
        <input
          type="text"
          placeholder="Amount"
          value={amountValue}
          onChange={(e) => setAmountValue(e.target.value)}
          style={{
            padding: "10px",
            fontSize: "16px",
            borderRadius: "6px",
            border: "none",
            width: "94%",
            marginBottom: "20px"
          }}
        />

        {/* Date */}
        <input
          type="text"
          placeholder="Date (DD/MM/YYYY)"
          value={dateValue}
          onChange={(e) => setDateValue(e.target.value)}
          style={{
            padding: "10px",
            fontSize: "16px",
            borderRadius: "6px",
            border: "none",
            width: "94%",
            marginBottom: "20px"
          }}
        />

        {/* Brief Description */}
        <textarea
          placeholder="Description (optional)"
          value={descriptionValue}
          onChange={(e) => setDescriptionValue(e.target.value)}
          rows={5} // show 5 lines by default
          style={{
            padding: "10px",
            fontSize: "16px",
            borderRadius: "6px",
            border: "none",
            width: "94%",
            marginBottom: "20px",
            resize: "vertical" // optional: allow vertical resizing
          }}
        />

        {/* Register Button */}
        <button
        onClick={handleRegister}
        style={{
            marginTop: "20px",
            padding: "12px 24px",
            backgroundColor: "#003366",
            color: "white",
            borderRadius: "6px",
            fontSize: "16px",
            cursor: "pointer"
        }}
        >
        Add
        </button>
      </div>

      {/* Main Content Area */}
      <div style={{
        flex: 1,
        padding: "40px",
        textAlign: "center"
      }}>
        <h1>Financial Planner</h1>
        <p>Analytics and charts will go here.</p>
        {typeOption && <p>Transaction Type: {typeOption}</p>}
        {categoryOption && <p>Category: {categoryOption}</p>}
        {amountValue && <p>Amount: {amountValue}</p>}
      </div>

    </div>
  );
}

export default Planner;
